import React from 'react';

import './Services.css';
import Grid from '@material-ui/core/Grid';
import marketplaceLogo from '../../assets/images/marketplaceLogo.svg';
import intelligenceLogo from '../../assets/images/intelligenceLogo.svg';
import toolkitLogo from '../../assets/images/toolkitLogo.svg';


const services = props => {
  return (
    <div className="">
        
        <Grid container className="">
        <Grid item md={2} xs={1}>
      </Grid>
      <Grid container md={8} xs={10} spacing={2}>
          <Grid item xs={12}><h2>OUR SERVICES</h2></Grid>
          <Grid item xs={6}><h3>We provide a range of knowledge based services with focus on our freelance platform, consultancy and IT tools.</h3></Grid>
          <Grid item xs={6}></Grid>
          
          <Grid item lg={4} md={12} xs={12} className="container">
          <div className="contain"><img src={marketplaceLogo} /></div>
          </Grid>
          <Grid item lg={4} md={12} xs={12} className="container">
          <div className="contain"><img src={intelligenceLogo} /></div>          </Grid>
          <Grid item lg={4} md={12} xs={12} className="container">
          <div className="contain"><img src={toolkitLogo} /></div>
          </Grid>
      </Grid>
      
      <Grid item md={2}>
      </Grid>
      </Grid>
</div>
  );
    
};

export default services;
